import React, { useState, Component } from "react";
import { render } from "react-dom";
import Calendar from "react-calendar";
import DatePicker from 'react-datepicker';
import '../css/Report.css';
import { func } from "prop-types";



class Button extends Component {
    constructor(props) {
    super(props);
    this.state = {value: ''};

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.newIs = this.newIs.bind(this);
  	}

  handleChange(event) {
  		this.setState({value: event.target.value.toUpperCase()});
	}

  handleSubmit(event) {
    	alert('Esta seguro de ingresar con: ' + this.state.value);
    	event.preventDefault();
  	}
  	newIs(){
  		console.log(this.textInput.value);
  	}

  render() {

    return (
      <div className="Registry">
         <form onSubmit={this.handleSubmit}>
        <label>
          IS : 
          <input placeholder="Ingresa tu IS" ref={input => {this.textInput=input;}}
          type="text" value={this.state.value} onChange={this.handleChange} />
        </label>
        <input type="submit" value="Ingresar"  onClik={this.newIs}/>
        <div>
        
        
        <button className="button btn-normal" onClick={this.props.onhide}>Salir</button>

        </div>
      </form>
      </div>

      
    );
  }
}
export default Button;
